function App() {
  return (
  <>
    <Routes>
      <Route path="/" element={<Navbar />}>
        {/* <Route index element={<AllOrders />} /> */}
        <Route path="/signin" element={<SignIn />} />
        <Route path="/signup" element={<Signup />} />
      </Route>
    </Routes>
  </>      
  );
}

export default App;
